// Importa i pacchetti necessari
const express = require('express');
const cors = require('cors');
const ApiManager = require('./ApiManager');  // Assicurati di inserire il percorso corretto

// Crea un'istanza di Express
const app = express();

// Aggiungi il middleware cors
app.use(cors());

// Crea un'istanza di ApiManager
const apiManager = new ApiManager();

// Definisci una route che fa uso di ApiManager
app.get('/api/data', async (req, res) => {
    try {
        const response = await apiManager.makeRequest('/dataEndpoint');
        res.json(response.data);
    } catch (error) {
        res.status(500).json({ error: 'Internal Server Error' });
    }
});

// Avvia il server sulla porta desiderata
const port = process.env.PORT || 3000;
app.listen(port, () => {
    console.log(`Server listening on port ${port}`);
});
